#!/usr/bin/env python
import os
import subprocess
import sys
import time
from PySide6.QtCore import *
from PySide6.QtGui import *
from PySide6.QtWidgets import *


class ISEWindow(QWidget):
#    def __init__(self, parent=None):
#        super().__init__(parent)

    with open('ISE_log.txt', 'w') as f:
        f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - ###### Image Sequence Encoder Log\n')

    QUALITY_OPTIONS = [
        ["cinema room", "18"], # combobox item label, crf value
        ["high", "20"],
        ["average", "23"],
        ["potato soup", "26"]
    ]
    QUALITY_DEFAULT = "average"

    PRESETS = [
        ["slow but good", "veryslow"], # combobox item label, preset value
        # ["slower", "slower"],
        # ["slow", "slow"],
        ["normal", "medium"],
        # ["fast", "fast"],
        # ["faster", "faster"],
        # ["very fast", "veryfast"],
        ["quick and dirty", "ultrafast"]
    ]
    PRESET_DEFAULT = "normal"

    ACODECS = [
        ["aac", "aac"],
        ["copy", "copy"],
        ["mp3", "mp3"]
    ]
    ACODEC_DEFAULT = "copy"

    VCODECS = [
        ["H264", "libx264"],
        ["H265", "libx265"]
    ]
    VCODEC_DEFAULT = "H264"

    PREFS = os.getenv('TEMP') + '\\ImageSequenceEncoder.cfg'

    ICON = b''

    try:
        if sys.argv[1]:
            DROPPED_INPUT_PATH = sys.argv[1]
    except:
        print(f'No file detected from drag\'n\'drop. Proceeding.')

    def __init__(self, parent=None):
        super().__init__(parent)

        self.setWindowTitle("FFmpeg Transcoder")
        icon = QIcon()
        icon.addFile(u"C:/Users/Roikku/Documents/Repositories/ImageSequenceEncoder/ImageSequenceEncoder.ico", QSize(), QIcon.Normal, QIcon.Off)
#        icon.fromData(self.ICON)
        self.setWindowIcon(icon)
        self.setMinimumSize(400, 300)

        self.create_widgets()
        self.create_layout()
        self.create_connections()

    def create_widgets(self):
        self.ffmpeg_path_le = QLineEdit()
        self.ffmpeg_path_btn = QPushButton("...")
        self.ffmpeg_path_btn.setFixedWidth(30)
        self.ffmpeg_path_ClBtn = QPushButton("×")
        self.ffmpeg_path_ClBtn.setFixedWidth(30)
        if os.path.exists(self.PREFS):
            with open(self.PREFS) as f:
                f.seek(0)
                pref = f.read()
                self.ffmpeg_path_le.setText(pref)

        self.input_framerate = QDoubleSpinBox()
        self.input_framerate.setMaximum(1000.00)
        self.input_framerate.setValue(24.00)

        self.input_path_le = QLineEdit()
        self.input_path_btn = QPushButton("...")
        self.input_path_btn.setFixedWidth(30)
        self.input_path_ClBtn = QPushButton("×")
        self.input_path_ClBtn.setFixedWidth(30)
        try:
            if self.DROPPED_INPUT_PATH:
                self.input_path_le.setText(self.DROPPED_INPUT_PATH)
        except:
            pass

        self.input_audio_path_le = QLineEdit()
        self.input_audio_path_btn = QPushButton("...")
        self.input_audio_path_btn.setFixedWidth(30)
        self.input_audio_path_ClBtn = QPushButton("×")
        self.input_audio_path_ClBtn.setFixedWidth(30)

        self.input_startFrame = QSpinBox()
        self.input_startFrame.setMaximum(1000000)
        self.input_startFrame.setMinimum(-1000000)
        self.input_startFrame.setValue(0)

        self.input_zeroPadding = QSpinBox()
        self.input_zeroPadding.setMaximum(10)
        self.input_zeroPadding.setMinimum(0)
        self.input_zeroPadding.setValue(3)

        self.output_path_le = QLineEdit()
        self.output_path_btn = QPushButton("...")
        self.output_path_btn.setFixedWidth(30)
        self.output_path_ClBtn = QPushButton("×")
        self.output_path_ClBtn.setFixedWidth(30)

        self.video_codec_combo = QComboBox()
        for vcodec in self.VCODECS:
            self.video_codec_combo.addItem(vcodec[0], vcodec[1])
        self.video_codec_combo.setCurrentText(self.VCODEC_DEFAULT)
        # self.video_codec_combo.addItem("h264", "libx264")

        self.quality_combo = QComboBox()
        for quality_option in self.QUALITY_OPTIONS:
            self.quality_combo.addItem(quality_option[0], quality_option[1])
        self.quality_combo.setCurrentText(self.QUALITY_DEFAULT)

        self.preset_combo = QComboBox()
        for preset in self.PRESETS:
            self.preset_combo.addItem(preset[0], preset[1])
        self.preset_combo.setCurrentText(self.PRESET_DEFAULT)

        self.audio_codec_combo = QComboBox()
        for acodec in self.ACODECS:
            self.audio_codec_combo.addItem(acodec[0], acodec[1])
        self.audio_codec_combo.setCurrentText(self.ACODEC_DEFAULT)
        self.transcode_btn = QPushButton("Transcode")
        self.cancel_btn = QPushButton("Cancel")

    def create_layout(self):

        ffmpeg_grp = QGroupBox("ffmpeg Path")
        ffmpeg_grp_layout = QHBoxLayout()
        ffmpeg_grp_layout.addWidget(self.ffmpeg_path_le)
        ffmpeg_grp_layout.addWidget(self.ffmpeg_path_btn)
        ffmpeg_grp_layout.addWidget(self.ffmpeg_path_ClBtn)
        ffmpeg_grp.setLayout(ffmpeg_grp_layout)

        input_grp = QGroupBox("Image Sequence path")
        input_grp_layout = QHBoxLayout()
        input_grp_layout.addWidget(self.input_path_le)
        input_grp_layout.addWidget(self.input_path_btn)
        input_grp_layout.addWidget(self.input_path_ClBtn)
        # input_grp_layout.addWidget(self.input_framerate)
        input_grp.setLayout(input_grp_layout)

        input_audio_grp = QGroupBox("Audio path (optional)")
        input_audio_grp_layout = QHBoxLayout()
        input_audio_grp_layout.addWidget(self.input_audio_path_le)
        input_audio_grp_layout.addWidget(self.input_audio_path_btn)
        input_audio_grp_layout.addWidget(self.input_audio_path_ClBtn)
        input_audio_grp.setLayout(input_audio_grp_layout)

        output_grp = QGroupBox("Output Path (optional)")
        output_grp_layout = QHBoxLayout()
        output_grp_layout.addWidget(self.output_path_le)
        output_grp_layout.addWidget(self.output_path_btn)
        output_grp_layout.addWidget(self.output_path_ClBtn)
        output_grp.setLayout(output_grp_layout)

        sequence_options_grp = QGroupBox("Image Sequence Options")
        sequence_options_grp_layout = QHBoxLayout()
        sequence_options_grp.setLayout(sequence_options_grp_layout)

        # sequence_options_grp_layout.addWidget("Start Frame:", self.input_startFrame)
        # sequence_options_grp_layout.addWidget("Zero Paddin (zero is none):", self.input_zeroPadding)


        video_options_grp = QGroupBox("Video Options")
        video_options_grp_layout = QFormLayout()
        video_options_grp.setLayout(video_options_grp_layout)

        video_codec_layout = QHBoxLayout()
        video_codec_layout.addWidget(self.video_codec_combo)
        video_codec_layout.addStretch()
        video_options_grp_layout.addRow("Video Codec:", video_codec_layout)

        quality_layout = QHBoxLayout()
        quality_layout.addWidget(self.quality_combo)
        quality_layout.addStretch()
        video_options_grp_layout.addRow("Quality:", quality_layout)

        preset_layout = QHBoxLayout()
        preset_layout.addWidget(self.preset_combo)
        preset_layout.addStretch()
        video_options_grp_layout.addRow("Speed:", preset_layout)

        preset_layout = QHBoxLayout()
        preset_layout.addWidget(self.input_framerate)
        preset_layout.addStretch()
        video_options_grp_layout.addRow("Framerate:", preset_layout)

        audio_options_grp = QGroupBox("Audio Options")
        audio_options_grp_layout = QFormLayout()
        audio_options_grp.setLayout(audio_options_grp_layout)

        audio_codec_layout = QHBoxLayout()
        audio_codec_layout.addWidget(self.audio_codec_combo)
        audio_codec_layout.addStretch()
        audio_options_grp_layout.addRow("Audio Codec:", audio_codec_layout)

        options_layout = QHBoxLayout()
        options_layout.addWidget(video_options_grp)
        options_layout.addWidget(audio_options_grp)

        button_layout = QHBoxLayout()
        button_layout.addStretch()
        button_layout.addWidget(self.transcode_btn)
        button_layout.addWidget(self.cancel_btn)

        main_layout = QVBoxLayout(self)
        main_layout.addWidget(ffmpeg_grp)
        main_layout.addWidget(input_grp)
        main_layout.addWidget(input_audio_grp)
        main_layout.addWidget(output_grp)
        main_layout.addLayout(options_layout)
        main_layout.addStretch()
        main_layout.addLayout(button_layout)

    def create_connections(self):
        self.ffmpeg_path_btn.clicked.connect(self.set_ffmpeg_path)
        self.ffmpeg_path_ClBtn.clicked.connect(self.ffmpeg_path_le.clear)
        self.input_path_btn.clicked.connect(self.set_input_path)
        self.input_path_ClBtn.clicked.connect(self.input_path_le.clear)
        self.input_audio_path_btn.clicked.connect(self.set_input_audio_path)
        self.input_audio_path_ClBtn.clicked.connect(self.input_audio_path_le.clear)
        self.output_path_btn.clicked.connect(self.set_output_path)
        self.output_path_ClBtn.clicked.connect(self.output_path_le.clear)

        self.transcode_btn.clicked.connect(self.transcode)
        self.cancel_btn.clicked.connect(self.close)

    def set_ffmpeg_path(self):
        filters = ""
        selected_filter = ""

        ffmpeg_path, selected_filter = QFileDialog.getOpenFileName(self, "Set ffmpeg binary's path", "", filters, selected_filter)
        if ffmpeg_path:
            self.ffmpeg_path_le.setText(ffmpeg_path)
            with open(self.PREFS, 'w') as f:
                f.write(ffmpeg_path)

    def set_input_path(self):
        filters = "Images (*.png *.jpg *.exr *.tga *.bmp);;All (*.*)"
        selected_filter = "Images (*.png *.jpg *.exr *.tga *.bmp)"

        input_path, selected_filter = QFileDialog.getOpenFileName(self, "Select the first frame of image sequence", "", filters, selected_filter)
        if input_path:
            self.input_path_le.setText(input_path)

    def set_input_audio_path(self):
        filters = "Audio Files (*.mp3 *.wav *.aac *.m4a *.flac);;All (*.*)"
        selected_filter = "Audio Files (*.mp3 *.wav *.aac *.m4a *.flac)"

        input_audio_path, selected_filter = QFileDialog.getOpenFileName(self, "Select the audio file (optional)", "", filters, selected_filter)
        if input_audio_path:
            self.input_audio_path_le.setText(input_audio_path)

    def set_output_path(self):
        filters = "*.mp4;;*.mkv"
        selected_filter = "*.mp4"

        output_path, selected_filter = QFileDialog.getSaveFileName(self, "Save File As", "", filters, selected_filter)
        if output_path:
            self.output_path_le.setText(output_path)

    def transcode(self):

        ffmpeg_path = self.ffmpeg_path_le.text()
        if not ffmpeg_path:
            QMessageBox.critical(self, "Transcode Error", "ffmpeg path not set")
            return
        if not os.path.exists(ffmpeg_path):
            QMessageBox.critical(self, "Transcode Error", "ffmpeg binaries not found")
            return

        input_path = self.input_path_le.text()
        if not input_path:
            QMessageBox.critical(self, "Transcode Error", "Image sequence path not set")
            return
        if not os.path.exists(input_path):
            QMessageBox.critical(self, "Transcode Error", "Image sequence path does not exist")
            return

        input_audio_path = self.input_audio_path_le.text()
        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - ### CHECKING INPUT AUDIO PATH\n')
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - input_audio_path : {input_audio_path}\n')
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} -    lenght : {len(input_audio_path)}\n')
#        if input_audio_path:
#            if not os.path.exists(input_audio_path):
#                QMessageBox.critical(self, "Transcode Error", "Audio path does not exist")
#                return
        if not input_audio_path:
            with open('ISE_log.txt', 'a') as f:
                f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - input_audio_path empty. Trying to seek an audio file from the input path\'s directory...\n')
#            QMessageBox.critical(self, "Transcode Error", "Audio path not set")
#            return
            try:
                default_audio_path = os.path.dirname(self.DROPPED_INPUT_PATH) + "/audio.mp3"
                if os.path.exists(default_audio_path):
                    input_audio_path = default_audio_path
                    with open('ISE_log.txt', 'a') as f:
                        f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - found {self.DROPPED_INPUT_PATH}/audio.mp3\n')
#                    return
            except:
                with open('ISE_log.txt', 'a') as f:
                    f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - No audio.mp3 found alongside input frame.\n')
                pass
        if input_audio_path:
            with open('ISE_log.txt', 'a') as f:
                f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - input_audio_path detected. Checking if exists...\n')
            if not os.path.exists(input_audio_path):
                QMessageBox.critical(self, "Transcode Error", "Audio path does not exist")
                return
            else:
                with open('ISE_log.txt', 'a') as f:
                    f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - found {input_audio_path}\n')

        output_path = self.output_path_le.text()
        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - ### CHECKING OUTPUT PATH\n')
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - output_path : {output_path}\n')
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} -    lenght : {len(output_path)}\n')
        if not output_path:
#            QMessageBox.critical(self, "Transcode Error", "Output path not set")
            output_path = input_path.rsplit(".",1)[0]+"__"+time.strftime("%Y-%m-%d_%H-%M-%S")+'.mp4'
            with open('ISE_log.txt', 'a') as f:
                f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - output_path empty. using input dir instead:\n')
                f.write(f'      {output_path}\n')
#            return

        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - ### Image sequence frame analysis\n')
        _input_path = input_path.rsplit(".")[0]
        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - _input_path:\n')
            f.write(f'                      {_input_path}\n')
        frame_number = _input_path.rsplit("_",1)[-1]
        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - frame_number:{frame_number}\n')
        if frame_number[:1] == "0":
            input_sequence = _input_path.rsplit("_",1)[0] + "_%0" + str(len(frame_number)) + "d." + input_path.rsplit(".")[1]
        else:
            input_sequence = _input_path.rsplit("_",1)[0] + "_%6d." + input_path.rsplit(".")[1]
        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - corrected input_sequence :\n')
            f.write(f'                      {input_sequence}\n')

        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - ### Encoding Parameters\n')
        video_codec = self.video_codec_combo.currentData()
        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - video codec : {video_codec}\n')
        crf = self.quality_combo.currentData()
        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - CRF         : {crf}\n')
        preset = self.preset_combo.currentData()
        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - preset      : {preset}\n')
        framerate = str(self.input_framerate.value())
        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - framerare   : {framerate}\n')

        audio_codec = self.audio_codec_combo.currentData()
        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - audio codec : {audio_codec}\n')

#        args = [ffmpeg_path]                                                    # executable path
#        args.extend(["-hide_banner", "-y"])                                     # global options
#        args.extend(["-r", framerate])                                          # input framerate
#        args.extend(["-start_number", frame_number])                            # start frame number
#        args.extend(["-i", input_sequence])                                     # input path
#        if input_audio_path:
#            args.extend(["-i", input_audio_path])                               # input audio path
#            if audio_codec != "copy":
#                args.extend(["-filter_complex", '"[1:0]apad"', "-shortest"])     # max lenght to video
#        args.extend(["-c:v", video_codec, "-crf", crf, "-preset", preset])      # video output options
#        args.extend(["-c:a", audio_codec])                                      # audio output options
#        args.append(output_path)                                                # output path

        args = ffmpeg_path                                                       # executable path
        args += f' -hide_banner -y'                                              # global options
        args += f' -r {framerate}'                                               # input framerate
        args += f' -start_number {frame_number}'                                 # start frame number
        args += f' -i {input_sequence}'                                          # input path
        if input_audio_path:
            args += f' -i {input_audio_path}'                                    # input audio path
            if audio_codec != "copy":
                args += f' -filter_complex \"[1:0]apad\" -shortest'              # max lenght to video
        args += f' -c:v {video_codec} -crf {crf} -preset {preset}'               # video output options
        args += f' -c:a {audio_codec} '                                          # audio output options
        args += output_path                                                      # output path

        print(f'args :\n{args}')

        with open('ISE_log.txt', 'a') as f:
            f.write(f'{time.strftime("%Y-%m-%d_%H-%M-%S")} - FFmpeg Command:\n')
            f.write(f'                      {args}\n')

        subprocess.call(args)

        QMessageBox.information(self, "Transcode Complete", "File transcode operation complete.")


if __name__ == "__main__":
    app = QApplication([])
    window = ISEWindow()
    window.show()
    sys.exit(app.exec())


    input()
